CREATE DEFINER=`nms`@`%` PROCEDURE `Event_list_porc`(
	IN `where1` VARCHAR(100),
	IN `search` VARCHAR(100)

)
BEGIN



   DROP TEMPORARY TABLE IF EXISTS temp_log;
   CREATE TEMPORARY TABLE temp_log (
		tempno int NOT NULL AUTO_INCREMENT,
		no int,
		name varchar(100),
		flag int,
		UNIQUE KEY DA_AUTO_INCREMENT_TEST_IDX01(tempno)	
	);


	set @sql := CONCAT("insert into temp_log(name, flag) select distinct  name, flag from event_list ", search );

   PREPARE stmt from @sql; 
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

	

   DROP TEMPORARY TABLE IF EXISTS temp_log2;
   CREATE TEMPORARY TABLE temp_log2 (
		tempno int  NOT NULL,
		no int,
		name varchar(100),
		flag int
	);


	set @sql := CONCAT("insert into temp_log2(tempno,name, flag) 
	select tempno,name, flag from temp_log where ",where1," order by no desc");

	PREPARE stmt from @sql; 
	EXECUTE stmt;
	DEALLOCATE PREPARE stmt;

	select  * from temp_log2  order by no desc;
	
END ;;
