    If @recCount1 = 0 THEN
			insert into Server_Down_Log(serverip, time, mail_send_time) 
			select serverip1, now(), date_add(now(), INTERVAL -11 MINUTE);

			
	end if;
		
		
	SET @recCount2 = (select  DATE_ADD(time,  INTERVAL 10 MINUTE)  from Server_Down_Log where serverip = serverip1 order by time desc limit 1);
    If @recCount2 < now() THEN
		insert into Server_Down_Log(serverip, time, mail_send_time)
		select serverip1, now(), now();
	end if;



	

END ;;
